namespace RonSijm.FluidHumidifier.Factories.CloudWatch;

public class MetricStreamFactory(string resourceName = null, Action<Humidifier.CloudWatch.MetricStream> factoryAction = null) : ResourceFactory<Humidifier.CloudWatch.MetricStream>(resourceName)
{

    internal List<InnerMetricStreamMetricStreamStatisticsConfigurationFactory> StatisticsConfigurationsFactories { get; set; } = [];

    internal List<InnerMetricStreamMetricStreamFilterFactory> IncludeFiltersFactories { get; set; } = [];

    internal List<InnerMetricStreamMetricStreamFilterFactory> ExcludeFiltersFactories { get; set; } = [];

    protected override Humidifier.CloudWatch.MetricStream Create()
    {
        var metricStreamResult = CreateMetricStream();
        factoryAction?.Invoke(metricStreamResult);

        return metricStreamResult;
    }

    private Humidifier.CloudWatch.MetricStream CreateMetricStream()
    {
        var metricStreamResult = new Humidifier.CloudWatch.MetricStream
        {
            GivenName = InputResourceName,
        };

        return metricStreamResult;
    }
    public override void CreateChildren(Humidifier.CloudWatch.MetricStream result)
    {
        base.CreateChildren(result);

        result.StatisticsConfigurations = StatisticsConfigurationsFactories.Any() ? StatisticsConfigurationsFactories.Select(x => x.Build()).ToList() : null;
        result.IncludeFilters = IncludeFiltersFactories.Any() ? IncludeFiltersFactories.Select(x => x.Build()).ToList() : null;
        result.ExcludeFilters = ExcludeFiltersFactories.Any() ? ExcludeFiltersFactories.Select(x => x.Build()).ToList() : null;
    }

} // End Of Class

